import React from 'react';

const About = () => {
    return (
        <div>
            <h1>About Me</h1>
            <p>My name is Rajvi Soneji, and I am a Frontend Web Developer.</p>
            <p>I studied at   SMT Chandanben Shantilal Swarupchand Shah BCA College, Deesa , where I earned my degree in Bachelor of Computer Application (May 2020 - Jun 2023).</p>
            <p>Here are some of my skills:</p>
            <ul>
                <li>	Problem-solving and critical thinking</li> 
                <li>	Strong communication skills</li>
                <li>	Team collaboration and innovate</li>
                <li>	Attention to detail and user-centered design</li>
                {/* Add more skills as needed */}
            </ul>
            <h3>
            Frontend Development Training 
            </h3>
            <p>Elsner Technologies Pvt. Ltd. [May 2024] to [Oct 2024]</p>
                	Successfully completed a structured training program focused on frontend development.
                <>	Gained proficiency in HTML, CSS, JavaScript, and React.js through real-world projects.</>
                <li>	Built and designed responsive web pages, ensuring cross-browser compatibility.</li>
                <li>	Collaborated with other trainees on group projects, applying best practices in frontend development.</li>
                <li>	Certificate: Received a certification for completing the training.</li>

        </div>
    );
};

export default About;
